.Do the forest and the pond have similar landscape?</p>\\n\\n<p>2. Do the forest and the pond have similar environmental conditions?</p>\\n\\n<p>3. What types of plants will each of the groups most likely find?</p>\\n\\n<p>4. What types of animals will each of the groups most likely find?</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"823da760-d22a-4454-a646-9e509e359dcd\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC PDM","title":"School Field Trip","defaultLanguage":"und","authors":[{"name":"LAL - Tabshoura","role":"Author"}]},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Column-1.15/scripts/h5p-column.js?version=1.15.2"],"styles":["/h5p/libraries/H5P.Image-1.1/image.css?version=1.1.22","/h5p/libraries/H5P.AdvancedText-1.1/text.css?version=1.1.14","/h5p/libraries/H5P.Column-1.15/styles/h5p-column.css?version=1.15.2"],"url":".","exportUrl":"/h5p/download/988327328"}},"core":{"scripts":["/h5p/core/js/jquery.js?version=1.24-master","/h5p/core/js/h5p.js?version=1.24-master","/h5p/core/js/h5p-event-dispatcher.js?version=1.24-master","/h5p/core/js/h5p-x-api-event.js?version=1.24-master","/h5p/core/js/h5p-x-api.js?version=1.24-master","/h5p/core/js/h5p-content-type.js?version=1.24-master","/h5p/core/js/h5p-confirmation-dialog.js?version=1.24-master","/h5p/core/js/h5p-action-bar.js?version=1.24-master","/h5p/core/js/request-queue.js?version=1.24-master"],"styles":["/h5p/core/styles/h5p.css?version=1.24-master","/h5p/core/styles/h5p-confirmation-dialog.css?version=1.24-master","/h5p/core/styles/h5p-core-button.css?version=1.24-master"]},"l10n":{"H5P":{"fullscreen":"Fullscreen","disableFullscreen":"Disable fullscreen","download":"Download","copyrights":"Rights of use","embed":"Embed","si
